import React from 'react';
import { motion } from 'framer-motion';
import { useTheme } from '../ThemeContext';

function About() {
  const { theme } = useTheme();

  // Define light and dark theme styles
  const lightThemeStyles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      backgroundColor: '#fff', // White background for light theme
      color: '#000', // Black text for light theme
    },
    hero: {
      backgroundColor: '#4CAF50', // Green background for hero section
      color: 'white',
      padding: '4rem 2rem',
      textAlign: 'center',
    },
    heroTitle: {
      fontSize: '3rem',
      marginBottom: '1rem',
    },
    heroText: {
      fontSize: '1.2rem',
      maxWidth: '700px',
      margin: '0 auto',
    },
    section: {
      display: 'flex',
      flexWrap: 'wrap',
      padding: '4rem 2rem',
      alignItems: 'center',
      gap: '2rem',
      justifyContent: 'center',
    },
    subHeading: {
      color: '#333', // Dark text for subheading
      marginBottom: '1rem',
    },
    paragraph: {
      fontSize: '1.1rem',
      color: '#555', // Grey text for paragraph
      marginBottom: '1rem',
    },
    mission: {
      backgroundColor: '#f9f9f9', // Light background for mission section
      padding: '4rem 2rem',
      textAlign: 'center',
    },
    missionTitle: {
      color: '#4CAF50', // Green text for mission title
      marginBottom: '1rem',
    },
    missionText: {
      fontSize: '1.2rem',
      color: '#555',
      maxWidth: '700px',
      margin: '0 auto',
    },
  };

  const darkThemeStyles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      backgroundColor: '#1f2937', // Dark background for dark theme
      color: '#eaeaea', // Light text for dark theme
    },
    hero: {
      backgroundColor: '#2E8B57', // Dark green background for hero section
      color: 'white',
      padding: '4rem 2rem',
      textAlign: 'center',
    },
    heroTitle: {
      fontSize: '3rem',
      marginBottom: '1rem',
    },
    heroText: {
      fontSize: '1.2rem',
      maxWidth: '700px',
      margin: '0 auto',
    },
    section: {
      display: 'flex',
      flexWrap: 'wrap',
      padding: '4rem 2rem',
      alignItems: 'center',
      gap: '2rem',
      justifyContent: 'center',
    },
    subHeading: {
      color: '#90ee90', // Light green text for subheading
      marginBottom: '1rem',
    },
    paragraph: {
      fontSize: '1.1rem',
      color: '#ccc', // Light grey text for paragraph
      marginBottom: '1rem',
    },
    mission: {
      backgroundColor: '#111827', // Dark background for mission section
      padding: '4rem 2rem',
      textAlign: 'center',
    },
    missionTitle: {
      color: '#90ee90', // Light green text for mission title
      marginBottom: '1rem',
    },
    missionText: {
      fontSize: '1.2rem',
      color: '#ccc',
      maxWidth: '700px',
      margin: '0 auto',
    },
  };

  // Choose the styles based on the current theme
  const themedStyles = theme === 'dark' ? darkThemeStyles : lightThemeStyles;

  return (
    <div style={themedStyles.container}>
      {/* Hero Section */}
      <section style={themedStyles.hero}>
        <h1 style={themedStyles.heroTitle}>About PEAS</h1>
        <p style={themedStyles.heroText}>
          Your Smart Ticket Booking Assistant for Museums across Tamil Nadu
        </p>
      </section>

      {/* About Content Section */}
      <section style={themedStyles.section}>
        {/* Text Part */}
        <div style={themedStyles.textContainer}>
          <h2 style={themedStyles.subHeading}>Discover Tamil Nadu’s Rich Heritage</h2>
          <p style={themedStyles.paragraph}>
            PEAS (Personalized Easy Assistant Service) is designed to simplify the way you book museum tickets across Tamil Nadu.
            We bring you closer to the vibrant culture, ancient history, and artistic brilliance of our state — all through a smart and easy chatbot experience.
          </p>
          <p style={themedStyles.paragraph}>
            Whether you're a student, tourist, or history enthusiast, PEAS makes your journey seamless — search museums by district, chat for instant details, and book your entry effortlessly.
          </p>
        </div>

        {/* Image Part */}
        <div style={themedStyles.imageContainer}>
          <motion.img
            src="/images/gandhi-museum-madurai.jpg"
            alt="Museum Tamil Nadu"
            style={themedStyles.image}
            whileHover={{ scale: 1.05 }}
            transition={{ type: "spring", stiffness: 300 }}
          />
        </div>
      </section>

      {/* Mission Section */}
      <section style={themedStyles.mission}>
        <h2 style={themedStyles.missionTitle}>Our Mission</h2>
        <p style={themedStyles.missionText}>
          To empower everyone to access Tamil Nadu’s cultural heritage easily, preserving our traditions while making exploration effortless and enjoyable.
        </p>
      </section>
    </div>
  );
}

export default About;
